(25431, 'We therefore ask you to pay us the full amount within a week. After this deadline, we entrust the file to our firm which will implement all the necessary steps to recover your debit.', 'nl_BE', 'Wij vragen u daarom het volledige bedrag binnen een week aan ons te betalen. Na deze deadline vertrouwen we het dossier toe aan ons kantoor dat alle nodige stappen zal ondernemen om uw debet terug te vorderen.'),
(25432, 'Despite all the effort that we put in, it is possible that mistakes or errors may be escaped in the manual, if you want to contribute by correcting them, you can request access to edit', 'nl_BE', 'Ondanks alle moeite die we erin hebben gestoken, is het mogelijk dat er fouten of fouten in de handleiding zijn ontsnapt, als je wilt bijdragen door ze te corrigeren, kun je toegang vragen om te bewerken'),
(25433, 'Activate this option if you want to give the possibility that users can choose the language that they print the documents / PDF', 'nl_BE', 'Activeer deze optie als u de mogelijkheid wilt geven dat gebruikers de taal kunnen kiezen waarin ze de documenten / PDF afdrukken'),
(25434, 'The system GestiónManager is a module for factux.be created and developed by the Global Security Network company, which manages the manufacturing process of hearing aids.', 'nl_BE', 'Het systeem GestiónManager is een module voor factux.be gecreëerd en ontwikkeld door het bedrijf Global Security Network, dat het fabricageproces van hoortoestellen beheert.'),
(25435, 'We regret to note that you did not follow up on our previous reminder and that your account remains still debitor corresponding to your following unpaid invoices:', 'nl_BE', 'Het spijt ons te moeten vaststellen dat u geen gevolg heeft gegeven aan onze vorige herinnering en dat uw rekening nog steeds debiteur is die overeenkomt met uw volgende onbetaalde facturen:'),
